DROP TABLE IF EXISTS `provider`;

CREATE TABLE `provider` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `countryName` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `providerType` enum('ELECTRICITY','GAS','INTERNET') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `providerName` varchar(30) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `tariffName` varchar(40) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `basicRate` double DEFAULT NULL,
  `priceModel` enum('FIXED','PER_CONSUMPTION') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

